function Note() {
  return (
    <>
      <div className="card m-2">
                <div className="card-body">
                  {/* <h5 className="card-title">{note.title}</h5>
                  <p className="card-text">{note.content}</p> */}
                  <a href="/" className="card-link">Remove</a>
                </div>
              </div>
    </>
  )
}

export default Note
